import React from "react";
import Paper from "@material-ui/core/Paper";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});
function createData(name, work, context, mean) {
  return { name, work, context, mean };
}
const rows = [
  createData("1. กลุ่มงานสนับสนุนทั่วไป", 19, 6.0, 24),
  createData("2. กลุ่มงานสนับสนุนงานหลักทางด้านเทคนิคเฉพาะทาง", 237, 9.0, 37),
  createData("3. กลุ่มงานให้คำปรึกษา", 22, 16.0, 24),
  createData("4. กลุ่มงานบริหาร", 35, 3.7, 67, 4.3),
  createData("5. กลุ่มงานนโยบายและวางแผน", 35, 16.0, 49),
  createData("6. กลุ่มงานศึกษาวิจัยและพัฒนา", 19, 6.0, 24),
  createData("7. กลุ่มงานข่าวกรองและสืบสวน", 27, 9.0, 37),
  createData("8. กลุ่มงานออกแบบและพัฒนา", 22, 16.0, 24),
  createData("9. กลุ่มงานความสัมพันธ์ระหว่างประเทศ", 305, 3.7, 67),
  createData("10. กลุ่มงานบังคับใช้กฎหมาย", 36, 16.0, 49),
  createData("11. กลุ่มงานเผยแพร่ประชาสัมพันธ์", 15, 6.0, 24),
  createData("12. กลุ่มงานส่งเสริมความรู้", 27, 9.0, 37),
  createData("13. กลุ่มงานบริการประชาชนด้านสุขภาพและสวัสดิภาพ", 22, 16.0, 24),
  createData("14. กลุ่มงานบริหารประชาชนด้านศิลปวัฒนธรรม", 35, 3.7, 67),
  createData("15. กลุ่มงานบริหารประชาชนทางเทคนิคเฉพาะทาง", 36, 16.0, 49),
  createData("16. กลุ่มงานเอกสารราชการและทะเบียน", 15, 6.0, 24),
  createData("17. กลุ่มงานปกครอง", 23, 9.0, 37),
  createData("18. กลุ่มงานอนุรักษ์r", 26, 16.0, 24),
];

export default function ComplexGrid() {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <Paper className={classes.paper}>
        <TableContainer component={Paper}>
          <Table className={classes.table} aria-label="simple table">
            <TableHead>
              <TableRow>
                <TableCell></TableCell>
                <TableCell align="right">กิจกรรมการทำงาน</TableCell>
                <TableCell align="right">บริบทการทำงาน</TableCell>
                <TableCell align="right">ค่าเฉลี่ย</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {rows.map((row) => (
                <TableRow key={row.name}>
                  <TableCell component="th" scope="row">
                    {row.name}
                  </TableCell>
                  <TableCell align="right">{row.work}</TableCell>
                  <TableCell align="right">{row.context}</TableCell>
                  <TableCell align="right">{row.mean}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Paper>
    </div>
  );
}
